"use strict";(self.webpackChunkproval_docs=self.webpackChunkproval_docs||[]).push([[14048],{362149:e=>{e.exports=JSON.parse('{"tag":{"label":"Networking","permalink":"/docs/tags/networking","description":"Documents related to network infrastructure and management practices","allTagsPath":"/docs/tags","count":116,"items":[{"id":"cwa/dataviews/57536cce-bb4f-4ece-a29f-cdad67f4a870","title":"Active Directory - AD Active Computers (30 days)","description":"This document provides a summary of a dataview that displays a list of active computers in Active Directory that have logged in within the last 30 days. It includes details about dependencies, columns, and descriptions of each data point.","permalink":"/docs/cwa/dataviews/57536cce-bb4f-4ece-a29f-cdad67f4a870"},{"id":"cwa/scripts/6a427581-70ba-456b-8985-f16d9b051c35","title":"AD - Offline Domain Join","description":"This document provides a detailed overview of a script that allows a machine to join a domain even when it is not connected to the same network as the Domain Controller (DC). It outlines the variables used, the process involved, and the expected output, highlighting the efficiency gained through automation.","permalink":"/docs/cwa/scripts/6a427581-70ba-456b-8985-f16d9b051c35"},{"id":"cwa/monitors/51eaeefd-b300-4f9a-be28-fa01e6e83b5e","title":"Add - Wifi Profiles","description":"This document outlines the purpose and functionality of a monitor set designed to identify computers lacking specified Wi-Fi profiles. It details how the monitor set interacts with the relevant dataview and triggers scripts to ensure proper Wi-Fi configuration on managed Windows workstations.","permalink":"/docs/cwa/monitors/51eaeefd-b300-4f9a-be28-fa01e6e83b5e"},{"id":"cwa/scripts/df72be26-16b1-452a-b4e7-67e1bf48a86b","title":"Add Sites to Local Intranet","description":"This document provides a detailed overview of a script that adds specified sites to the local intranet zone on Windows computers. It includes sample runs, user parameters, and output details to help users understand how to utilize the script effectively.","permalink":"/docs/cwa/scripts/df72be26-16b1-452a-b4e7-67e1bf48a86b"},{"id":"cwrmm/tasks/ce5e9466-a5c3-487a-a9b7-5d204093e73e","title":"Add Wi-Fi Profile","description":"This document provides a detailed implementation guide for the Add-WifiProfile script in ConnectWise RMM, allowing users to manually add Wi-Fi profiles to Windows computers. It includes setup instructions, user parameters, task creation steps, and sample runs.","permalink":"/docs/cwrmm/tasks/ce5e9466-a5c3-487a-a9b7-5d204093e73e"},{"id":"powershell/ps-add-wifiprofile","title":"Add-WifiProfile","description":"Documentation for the Add-WifiProfile command to configure WiFi profiles.","permalink":"/docs/powershell/ps-add-wifiprofile"},{"id":"cwa/dataviews/231e029c-9c15-4a70-ac35-399e73d0d7bb","title":"Admin - Retired Assets Last 30 Days","description":"This document provides a summary of retired machines within the last 30 days, displaying relevant comments and details such as client name, location, machine name, operating system, manufacturer, internal IP address, and the date of retirement.","permalink":"/docs/cwa/dataviews/231e029c-9c15-4a70-ac35-399e73d0d7bb"},{"id":"cwa/dataviews/a326b230-2a55-42c6-a9bd-59ad1b1c3288","title":"Agent - Agent Check-in Over 30 Days","description":"This document provides a detailed summary of agents that have not checked in for 30 days, including their status, last contact date, and additional details about the client and location.","permalink":"/docs/cwa/dataviews/a326b230-2a55-42c6-a9bd-59ad1b1c3288"},{"id":"cwa/dataviews/be7bf652-a9eb-46c0-ae71-ffebd38c24b2","title":"Agent - Agent Check-in Over 45 Days","description":"This document provides a comprehensive overview of agents that have not checked in for 45 days, detailing their status, operating system, and various attributes related to their location and client information.","permalink":"/docs/cwa/dataviews/be7bf652-a9eb-46c0-ae71-ffebd38c24b2"},{"id":"cwa/monitors/b8313365-d95d-41bd-b2fc-e3e77f4fdcf7","title":"Agent Checking in with Wrong Location","description":"This document outlines the purpose and functionality of a monitor set designed to detect computers that are placed in the wrong location based on router addresses. It details how to define multiple router IPs, the format required for input, and provides sample screenshots for clarity.","permalink":"/docs/cwa/monitors/b8313365-d95d-41bd-b2fc-e3e77f4fdcf7"},{"id":"cwa/dataviews/fa20c478-2467-416f-a31a-ed32e9dbbbfe","title":"Agent ID assignment discrepancy","description":"This document provides a dataview that displays information about agents that have changed their names five times or more in the last 30 days, including details such as computer ID, client name, location, and more.","permalink":"/docs/cwa/dataviews/fa20c478-2467-416f-a31a-ed32e9dbbbfe"},{"id":"cwa/dataviews/dc8790d6-6784-4646-b763-f7eebe78a0b1","title":"Agents Potentially in Wrong Location","description":"This document provides a detailed overview of a Dataview that displays machines incorrectly placed in locations based on router addresses. It outlines the necessary columns and their descriptions to help identify misplacements and ensure accurate location tracking.","permalink":"/docs/cwa/dataviews/dc8790d6-6784-4646-b763-f7eebe78a0b1"},{"id":"cwa/dataviews/dab4d9d4-0e2c-40ae-8c95-12e00762c496","title":"Brute Force Attack Possible - By Attempted Account","description":"This document outlines a dataview designed to display potential brute force attacks against Windows devices by counting failed login attempts recorded in the ConnectWise Automate database. It provides insights into the accounts experiencing these attempts and highlights the importance of monitoring such events for security.","permalink":"/docs/cwa/dataviews/dab4d9d4-0e2c-40ae-8c95-12e00762c496"},{"id":"cwa/scripts/9d906bff-cc45-4a2b-b0c5-8e9f97c396a2","title":"Cisco AnyConnect - MAC","description":"This document provides a detailed guide for installing the Cisco AnyConnect application on Mac agents using a script. It includes information about the required files, process steps, and output logs, helping users automate the installation process efficiently.","permalink":"/docs/cwa/scripts/9d906bff-cc45-4a2b-b0c5-8e9f97c396a2"},{"id":"cwa/scripts/6cc27de0-595c-4406-8cdd-0b394950f337","title":"Cisco Secure Client - Package Installation Macintosh","description":"This document provides a detailed guide on how to install different Cisco Secure Client modules on a Mac machine, including prerequisites, variables, user parameters, and ticketing procedures for failed installations.","permalink":"/docs/cwa/scripts/6cc27de0-595c-4406-8cdd-0b394950f337"},{"id":"cwa/scripts/56bef066-f298-45c5-859b-123cb22a53d9","title":"Cisco Secure Client - Package Installation Windows","description":"This document provides a comprehensive guide on installing the Cisco Secure Client, including prerequisites, dependencies, user parameters, and detailed instructions for configuration and troubleshooting. It also covers the necessary steps to ensure successful deployment and management of the Cisco Secure Client modules.","permalink":"/docs/cwa/scripts/56bef066-f298-45c5-859b-123cb22a53d9"},{"id":"cwrmm/tasks/ab05999e-28bb-45af-adac-ba7bf32fd3a4","title":"Cisco Secure Client Package Installation (Windows)","description":"This document provides a comprehensive guide for implementing the Cisco Secure Client Package Installation via ConnectWise RMM. It details prerequisites, dependencies, script creation steps, and module definitions to ensure a successful installation of the Cisco Secure Client and its components.","permalink":"/docs/cwrmm/tasks/ab05999e-28bb-45af-adac-ba7bf32fd3a4"},{"id":"cwrmm/custom-fields/0dc22f98-f39e-4d02-9716-19087ff35e03","title":"Cisco Secure Client Parameter","description":"This document provides detailed instructions on how to store and use the parameter for installing the Cisco Secure Client package through a company-level custom field. It includes dependencies, sample values, and outcomes for various installation configurations.","permalink":"/docs/cwrmm/custom-fields/0dc22f98-f39e-4d02-9716-19087ff35e03"},{"id":"cwrmm/custom-fields/0c2128f8-2f99-47e7-a0ff-82b854ff2701","title":"Company - SentinelOne Site Key","description":"This document explains the configuration of the SentinelOne Site Key at the company level, which is essential for organizing and managing endpoints based on their network location. It includes details on dependencies, field specifications, and a screenshot for reference.","permalink":"/docs/cwrmm/custom-fields/0c2128f8-2f99-47e7-a0ff-82b854ff2701"},{"id":"cwa/scripts/76867be6-fe44-441a-92ce-e3d1124c361d","title":"Control Server Best Practice Ticket","description":"This document outlines the process of auditing and implementing hardening rules and policies for CW Control (on-prem) servers, focusing on security enhancements and compliance with best practices as per the recent CW guidelines.","permalink":"/docs/cwa/scripts/76867be6-fe44-441a-92ce-e3d1124c361d"},{"id":"cwa/roles/e0d72417-c019-465d-9c89-5f7ca7b72b25","title":"CVE-2020-1472 Enforcement Mode Disabled","description":"This document outlines the method to track Domain Controllers where Enforcement Mode is disabled, including the detection string, comparator, and applicable operating systems for effective monitoring.","permalink":"/docs/cwa/roles/e0d72417-c019-465d-9c89-5f7ca7b72b25"},{"id":"cwa/monitors/34bd969e-2ac4-4b80-bb2f-3aa2f37b6159","title":"CVE-2023-36884 - HTML Remote Code Execution","description":"This document details an internal monitor designed to detect online Windows agents where the office is installed, and where mitigation efforts for vulnerabilities have not been attempted.","permalink":"/docs/cwa/monitors/34bd969e-2ac4-4b80-bb2f-3aa2f37b6159"},{"id":"solutions/59fbb11b-df98-46a4-9b97-986b4f8e16f9","title":"CWA - Update Table Data - UnifiController","description":"This document provides a comprehensive guide on how to collect and integrate data from the Unifi controller into the ConnectWise Automate environment, including associated scripts and custom tables for efficient data management.","permalink":"/docs/solutions/59fbb11b-df98-46a4-9b97-986b4f8e16f9"},{"id":"cwa/scripts/f4ed7a7d-baf0-4aa5-8bbe-413fa024fff3","title":"CWM - Automate - Automate Server Security Best Practices","description":"This document provides a comprehensive guide to configuring a ConnectWise Automate server with security settings. It includes information on firewall port settings, global parameters, and sample output from the script execution. This guide is essential for ensuring server hardening and security compliance.","permalink":"/docs/cwa/scripts/f4ed7a7d-baf0-4aa5-8bbe-413fa024fff3"},{"id":"cwa/scripts/f99ddaae-0cb3-4941-b2aa-dc93671dd246","title":"CWM - Automate - RMM+ Plugin Configuration","description":"This document provides a detailed guide on configuring the RMM+ Plugin, including steps to create sessions for machines that have not checked in for a specified number of days. It covers the necessary settings in the client control portal and the Automate control center, ensuring a seamless integration and management of remote sessions.","permalink":"/docs/cwa/scripts/f99ddaae-0cb3-4941-b2aa-dc93671dd246"},{"id":"cwa/scripts/d201dea7-ec4b-4f44-b3b7-b49cd8a7f6af","title":"CWM - Automate - Software Install - Cisco Webex Deployment","description":"This document provides a script for installing user-based Cisco Webex on Windows machines, including sample runs, output logs, and error handling for installation failures.","permalink":"/docs/cwa/scripts/d201dea7-ec4b-4f44-b3b7-b49cd8a7f6af"},{"id":"cwa/scripts/964767a7-3de0-4dd4-aa7c-21bf7f6ad926","title":"Dell Command Configure - Installation","description":"This document details a script that installs Dell Command Configure version 3 or 4 based on the system specifications. The script saves approximately 10 minutes of manual installation time by automatically determining the appropriate version and executing the installation process, including verification and cleanup tasks.","permalink":"/docs/cwa/scripts/964767a7-3de0-4dd4-aa7c-21bf7f6ad926"},{"id":"cwa/monitors/77a9ff77-6e7a-474e-8796-d44f2066ff16","title":"Dell Hardware Monitoring","description":"This document provides a detailed overview of an internal monitor designed to detect critical and error event logs from Dell servers using the Server Administrator event source. It includes instructions on setting up the monitor and utilizing the appropriate alert template for ticket creation.","permalink":"/docs/cwa/monitors/77a9ff77-6e7a-474e-8796-d44f2066ff16"},{"id":"cwa/monitors/77a9ff77-6e7a-474e-8796-d44f2066ff16","title":"Dell Hardware Monitoring","description":"This document provides a detailed overview of an internal monitor designed to detect critical and error event logs from Dell servers using the Server Administrator event source. It includes instructions on setting up the monitor and utilizing the appropriate alert template for ticket creation.","permalink":"/docs/cwa/monitors/77a9ff77-6e7a-474e-8796-d44f2066ff16"},{"id":"cwa/scripts/c18b026e-7989-4853-b1cb-00517e69adb8","title":"Deploy OpenDNS Roaming Client Latest Version","description":"This document provides a comprehensive guide on a script that queries Cisco for the latest roaming client installation media and installs the software on target Mac or Windows devices. It includes implementation steps, dependencies, variables, and specific considerations for both operating systems.","permalink":"/docs/cwa/scripts/c18b026e-7989-4853-b1cb-00517e69adb8"},{"id":"cwa/scripts/1575f234-039a-4d1c-a4e5-ce0656e82c4f","title":"Desktop Shortcut - Create - RDP","description":"This document explains how to create an RDP shortcut on the desktop of each user on a Windows computer, utilizing the target computer\u2019s address or name from the Target parameter. It includes user parameters, output details, and sample run images.","permalink":"/docs/cwa/scripts/1575f234-039a-4d1c-a4e5-ce0656e82c4f"},{"id":"cwa/monitors/ce8d5706-137b-4a55-8a8b-5041e35421de","title":"DHCP Scope(s) < 25% and 20 IP Addresses Available","description":"This document outlines a remote monitor designed to retrieve information about active DHCP server scopes and their IP address statistics. It identifies DHCP servers with insufficient available IP addresses, alerting when active scopes have less than 20 IP addresses or 25% availability. The monitor considers reserved percentages for DHCP failover scopes and ensures both conditions are met before triggering an alert.","permalink":"/docs/cwa/monitors/ce8d5706-137b-4a55-8a8b-5041e35421de"},{"id":"cwa/monitors/2cfde48c-aa83-4990-83bd-cb768c882081","title":"DHCP Scope(s) < 25% IP Addresses Available","description":"This document provides detailed steps on how to apply a remote monitor for DHCP scopes with insufficient IP addresses. It includes SQL query examples and instructions for executing the queries within a RAWSQL monitor set, ensuring effective monitoring and alerting for network connectivity issues.","permalink":"/docs/cwa/monitors/2cfde48c-aa83-4990-83bd-cb768c882081"},{"id":"cwa/monitors/90ad5d20-a081-4027-b8e2-238cbdbe64d3","title":"DHCP Scope(s) < 5 IP Addresses Available","description":"This document outlines a remote monitor designed to retrieve information about DHCP server scopes and their corresponding IP address statistics. It filters out inactive scopes, focusing on active ones, and checks for those with 5 or fewer available IP addresses, alerting administrators to potential network connectivity issues.","permalink":"/docs/cwa/monitors/90ad5d20-a081-4027-b8e2-238cbdbe64d3"},{"id":"cwa/monitors/7cd56a9d-67d5-4d67-a8bf-f61497a93059","title":"Disable Netbios on Network Interfaces","description":"This document provides a guide on how to implement a remote monitor that disables NetBIOS on all network interfaces for Windows operating systems. It includes details on alert styles, ticketing, and the import process.","permalink":"/docs/cwa/monitors/7cd56a9d-67d5-4d67-a8bf-f61497a93059"},{"id":"cwa/scripts/2be0669b-3c87-4594-81f4-112c7411f513","title":"Disable NTLMv1.1","description":"This document provides a script that disables the NTLMv1.1 protocol on target Windows machines, specifically designed for use on Domain Controllers. It includes a sample run and output log details.","permalink":"/docs/cwa/scripts/2be0669b-3c87-4594-81f4-112c7411f513"},{"id":"cwa/dataviews/8e53a0ed-4b8a-4aec-9d92-99423964f53c","title":"DNS Assignments","description":"This document provides a detailed overview of the active network adapter settings for devices, including information on IP addresses, gateways, and adapter types. It outlines the necessary dependencies and describes the columns used in the data display, offering insights into network configurations and statuses.","permalink":"/docs/cwa/dataviews/8e53a0ed-4b8a-4aec-9d92-99423964f53c"},{"id":"cwa/scripts/3c802520-f292-46e2-bd0e-0dbca86ed0ed","title":"Domain - Join","description":"This document provides a detailed overview of a script that automates the process of joining a target machine to a domain. It includes user parameters, process explanation, and expected outputs, highlighting the time saved by automation.","permalink":"/docs/cwa/scripts/3c802520-f292-46e2-bd0e-0dbca86ed0ed"},{"id":"vsa/procedures/9a19342e-1fd7-4e68-b54a-6831f8eef5b8","title":"Endpoint VPN Configuration","description":"This document details the configuration of a VPN on endpoints using Managed Variable data, addressing various use cases such as additional connection gateways, Split Tunneling, and credential memory. It also outlines the creation of a desktop shortcut for user convenience.","permalink":"/docs/vsa/procedures/9a19342e-1fd7-4e68-b54a-6831f8eef5b8"},{"id":"cwa/monitors/7f795515-a2b5-4041-85c8-64b6c6e59470","title":"ESXi Old Snapshots Detected  3 Days","description":"This document describes a monitor that identifies ESXi host servers with snapshots older than three days, generating alerts and tickets for proactive management. It is intended to be used alongside a script for automatic ticket creation, ensuring timely resolution of issues related to virtual machine snapshots.","permalink":"/docs/cwa/monitors/7f795515-a2b5-4041-85c8-64b6c6e59470"},{"id":"solutions/deb78496-0147-4a1b-b368-3b3113f9cf5b","title":"ESXi Virtualization Manager Customized Monitoring","description":"This guide provides detailed instructions on sharing internal monitor details with partners regarding the Virtualization Manager plugin. It includes setup, implementation steps, and associated content for monitoring ESXi hosts.","permalink":"/docs/solutions/deb78496-0147-4a1b-b368-3b3113f9cf5b"},{"id":"cwa/monitors/69ce4eef-6126-486a-9b28-8626f847754e","title":"Ethernet Speed Less Than 100Mbps","description":"This document outlines a monitor designed to detect and create tickets when an agent reports an Ethernet adapter running at speeds less than 100 Mbps. It addresses common issues like bad cable connections or malfunctioning devices that can lead to reduced network performance.","permalink":"/docs/cwa/monitors/69ce4eef-6126-486a-9b28-8626f847754e"},{"id":"cwa/monitors/ab5fe07a-d644-4011-96bf-67aa8019216f","title":"Execute Script - Get Wifi Profile","description":"This document outlines the setup of a monitor set designed to execute the Get Wifi Profile script in Audit only mode on physical Windows workstations, excluding older versions such as Windows XP, 7, 8, and 8.1, on a monthly basis.","permalink":"/docs/cwa/monitors/ab5fe07a-d644-4011-96bf-67aa8019216f"},{"id":"cwa/monitors/a8f66140-8915-41fa-805b-64fafbf002fc","title":"Execute Script - HP iLO - Health Report - Get","description":"This document outlines the configuration and requirements for the automated internal monitor that runs the HP iLO Health Report script weekly. It details how to properly store credentials, the execution process, and adjustments for update frequency, ensuring consistent data collection without manual scheduling.","permalink":"/docs/cwa/monitors/a8f66140-8915-41fa-805b-64fafbf002fc"},{"id":"cwa/monitors/863ba816-8f4f-47e1-aa66-420b428b7188","title":"Execute Script - Internet Speed Test","description":"This document provides details about an internal monitor that detects Windows agents where the Internet Speed Audit script has not been run in the last 10 days. It outlines important considerations, dependencies, and target groups for implementation.","permalink":"/docs/cwa/monitors/863ba816-8f4f-47e1-aa66-420b428b7188"},{"id":"solutions/485b0ab5-8ce4-400c-9ba6-dff7967988aa","title":"Get - Printer Driver Inventory","description":"This document provides a comprehensive guide on how to pull installed print driver version information into ConnectWise Automate. It includes associated scripts, custom tables, and dataviews necessary for effective implementation and troubleshooting.","permalink":"/docs/solutions/485b0ab5-8ce4-400c-9ba6-dff7967988aa"},{"id":"cwa/scripts/d97282c0-4d81-46f9-b821-d553c2d8a596","title":"Get Wifi Profile","description":"This document details the implementation of the Get-WifiProfile script within ConnectWise Automate, providing instructions on its execution, required parameters, and output generated, including log files and data views.","permalink":"/docs/cwa/scripts/d97282c0-4d81-46f9-b821-d553c2d8a596"},{"id":"powershell/ps-get-hpilohealthreport","title":"Get-HPiLOHealthReport","description":"Documentation for the Get-HPiLOHealthReport command to get a health report from the target HP iLO address.","permalink":"/docs/powershell/ps-get-hpilohealthreport"},{"id":"powershell/ps-get-unificontroller","title":"Get-UnifiController","description":"Documentation for the Get-UnifiController command to retrieve and return data from a Unifi Controller.","permalink":"/docs/powershell/ps-get-unificontroller"},{"id":"powershell/ps-get-wifiprofile","title":"Get-WifiProfile","description":"Documentation for the Get-WifiProfile command to retrieve and return Wi-Fi profiles on the system.","permalink":"/docs/powershell/ps-get-wifiprofile"},{"id":"vsa/procedures/6e117467-8d11-4ad3-83a3-69ee61aaca85","title":"GetPDC - Stack Content","description":"This document provides a comprehensive guide on how to retrieve the Primary Domain Controller in a Windows environment, including the necessary commands and explanations to ensure proper execution.","permalink":"/docs/vsa/procedures/6e117467-8d11-4ad3-83a3-69ee61aaca85"},{"id":"cwa/scripts/47e125c4-26df-4b47-811b-b856f3395290","title":"GetRemoveAdd Wifi Profiles","description":"This document outlines a script designed to manage Wi-Fi profiles on end-user machines, including retrieval, removal, and addition of profiles. It provides detailed instructions on usage, including parameters for adding and removing profiles, as well as important updates and examples.","permalink":"/docs/cwa/scripts/47e125c4-26df-4b47-811b-b856f3395290"},{"id":"cwa/dataviews/058e4fab-a293-4f8e-b737-7ac47e0fd227","title":"Hardware - NIC Info With Firmware Details","description":"This document provides a summary of a Dataview that displays information about existing network adapters, including details such as client name, location name, computer name, NIC type, NIC name, driver name, and driver version.","permalink":"/docs/cwa/dataviews/058e4fab-a293-4f8e-b737-7ac47e0fd227"},{"id":"cwa/monitors/fc109cdb-9f88-448b-8c57-b866b2e3c7c2","title":"Heartbeat Anomaly Audit","description":"This document outlines the implementation of a monitor that creates a ticket in ProVal\'s AutoTask Portal when fewer heartbeats than expected are detected from machines checking in within the environment. It includes dependencies, target settings, and ticketing details for alerts.","permalink":"/docs/cwa/monitors/fc109cdb-9f88-448b-8c57-b866b2e3c7c2"},{"id":"cwa/scripts/3067b867-c1d4-4f7b-9a21-5344c7078931","title":"Hosts File - Add","description":"This document describes a script that modifies the host file on a machine by taking user-defined parameters for DNS names and IP addresses. It includes a sample run, dependencies, user parameters, and the process for execution, ensuring proper management of DNS entries.","permalink":"/docs/cwa/scripts/3067b867-c1d4-4f7b-9a21-5344c7078931"},{"id":"cwa/scripts/f28ef90e-ba80-4ba1-9bd6-e4aa4c2b549a","title":"HP iLO - Health Report - Get","description":"This document provides a comprehensive guide on how to retrieve an iLO health report using a PowerShell script. It includes requirements, client-level password entry instructions, sample runs, dependencies, and ticketing capabilities for failures encountered during execution.","permalink":"/docs/cwa/scripts/f28ef90e-ba80-4ba1-9bd6-e4aa4c2b549a"},{"id":"vsa/procedures/31670a91-868f-4825-9be0-ed842d62b7c0","title":"HP Image Assistant - Deploy","description":"This document outlines the procedure for deploying HP Image Assistant to endpoints, including downloading, extracting, and installing the software. It provides detailed logs of the agent procedure for transparency and troubleshooting.","permalink":"/docs/vsa/procedures/31670a91-868f-4825-9be0-ed842d62b7c0"},{"id":"cwa/scripts/cffbdce7-7390-4b11-9300-6a34799b7d82","title":"Implement Wifi Profile","description":"This document details a script for adding and removing Wi-Fi profiles on targeted machines using ConnectWise Automate. It provides instructions on how to supply profile names for addition and removal, along with examples, dependencies, and user parameters.","permalink":"/docs/cwa/scripts/cffbdce7-7390-4b11-9300-6a34799b7d82"},{"id":"cwa/monitors/e6d09f37-fd0f-42a6-98a5-449f65673296","title":"Implement- SMB1 Traffic Detection","description":"This document provides a step-by-step guide to set up the SMB1 Traffic Detection Remote Monitor using SQL queries. It includes instructions for inserting necessary searches and groups, refreshing searches, and validating the setup.","permalink":"/docs/cwa/monitors/e6d09f37-fd0f-42a6-98a5-449f65673296"},{"id":"cwa/monitors/81c88531-4918-4d74-ac84-efbc2c3cfe51","title":"Import- DHCP Scope(s) < 5 IP Addresses Available","description":"This document provides a detailed guide on how to apply a remote monitor to specific groups in ConnectWise Automate. It outlines the steps for obtaining group IDs, constructing SQL queries for inserting group agents, and executing those queries to ensure proper monitoring of DHCP scopes with insufficient IP addresses.","permalink":"/docs/cwa/monitors/81c88531-4918-4d74-ac84-efbc2c3cfe51"},{"id":"powershell/ps-install-ciscosecureclient","title":"Install-CiscoSecureClient","description":"Documentation for the Install-CiscoSecureClient command to install the Cisco Secure Client and selected modules.","permalink":"/docs/powershell/ps-install-ciscosecureclient"},{"id":"cwa/dataviews/706c1dcb-998c-4d1e-a046-ab7538429aa7","title":"Internet Speed - Audit","description":"This document provides detailed information on the audited speed test results from the custom table EPM - Network - Custom Table - plugin_proval_speedtest_audit, including various metrics such as latency, jitter, download and upload speeds, and more.","permalink":"/docs/cwa/dataviews/706c1dcb-998c-4d1e-a046-ab7538429aa7"},{"id":"cwa/scripts/54ed691f-e7be-4709-8967-72a4c9c782f6","title":"Internet Speed - Audit","description":"This document provides a detailed guide on running an internet speed test using the Ookla SpeedTest CLI application. It includes sample runs, dependencies, user parameters, global parameters, and the output generated by the script. The results can be saved to a database and emailed to specified addresses.","permalink":"/docs/cwa/scripts/54ed691f-e7be-4709-8967-72a4c9c782f6"},{"id":"cwrmm/tasks/296c457d-66d6-4de8-af91-4667c2321e12","title":"Internet Speed - Audit","description":"This document provides a comprehensive guide on how to run an internet speed test using the Ookla SpeedTest CLI application. It includes sample runs, dependencies, task creation steps, and detailed instructions on implementing the script in a system.","permalink":"/docs/cwrmm/tasks/296c457d-66d6-4de8-af91-4667c2321e12"},{"id":"cwa/roles/bfeadced-7753-468a-9119-b2b7f4499cf2","title":"IPv6 Enabled","description":"This document outlines the steps to identify machines where IPv6 is enabled on any network adapter. It includes a detection string, comparator, and applicable operating systems for effective implementation.","permalink":"/docs/cwa/roles/bfeadced-7753-468a-9119-b2b7f4499cf2"},{"id":"cwrmm/custom-fields/b6a7c804-693c-4cf5-a60e-61dcb10ddcae","title":"Is Primary Domain Controller","description":"This document outlines the process to validate whether a computer is a primary domain controller. It details the dependencies and provides sample values for the custom field used in the ConnectWise RMM platform.","permalink":"/docs/cwrmm/custom-fields/b6a7c804-693c-4cf5-a60e-61dcb10ddcae"},{"id":"cwa/scripts/c9c8a58e-fd25-4596-822c-b6847c782e9c","title":"Location Ping Monitors - Create","description":"This document provides a comprehensive guide on setting up Remote Monitors for Location Ping Monitors, detailing the necessary procedures, system properties, and Extra Data Fields (EDFs) required to effectively monitor location connectivity and trigger alerts when a location becomes unreachable.","permalink":"/docs/cwa/scripts/c9c8a58e-fd25-4596-822c-b6847c782e9c"},{"id":"cwa/scripts/cc09c16e-c62b-4001-9226-1b92097a6507","title":"LTTray Port Mapping with System Registry","description":"This document describes a script designed to resolve the intermittent issue of LTTray not showing by mapping the port number from netstat and the Windows registry. It includes a detailed process overview, sample run, and dependencies for effective implementation.","permalink":"/docs/cwa/scripts/cc09c16e-c62b-4001-9226-1b92097a6507"},{"id":"cwa/scripts/f04ef005-9203-4967-9bcc-11457c91d2dc","title":"Move New Agent to Matching Location (DomainRouter)","description":"This document describes a script that automates the process of moving new or unassigned computers from Location ID 1 to their appropriate locations based on matching domain or router addresses, saving time and improving efficiency.","permalink":"/docs/cwa/scripts/f04ef005-9203-4967-9bcc-11457c91d2dc"},{"id":"vsa/procedures/6c3d68e8-61cd-4e74-a13f-d6be1516feec","title":"Network Detective Workstation  Server","description":"This document outlines the procedures for deploying the Network Detective tool to workstations or servers, executing scans, and logging the results for further analysis. It includes detailed steps, dependencies, and expected outcomes.","permalink":"/docs/vsa/procedures/6c3d68e8-61cd-4e74-a13f-d6be1516feec"},{"id":"cwa/dataviews/a54c73f8-ca6b-4adb-988c-705818e804f7","title":"Network Devices Not Contacted from 60 Days","description":"This document provides a comprehensive overview of the Dataview designed to identify network devices that have not been active in ConnectWise Automate for the past 60 days. It outlines dependencies, columns included in the Dataview, and how it can be utilized for monitoring and management of network devices.","permalink":"/docs/cwa/dataviews/a54c73f8-ca6b-4adb-988c-705818e804f7"},{"id":"cwa/dataviews/fae65619-a5a4-44ec-923a-69d1f20726ff","title":"Network Drives","description":"This document provides detailed information about attached network drives for ConnectWise Automate agents, including descriptions of key columns such as Client Name, Location Name, Computer Name, and more.","permalink":"/docs/cwa/dataviews/fae65619-a5a4-44ec-923a-69d1f20726ff"},{"id":"cwa/monitors/4e0f7314-bf88-44de-a162-139c191e6e09","title":"Network Glue - Deployment","description":"This document outlines the auto deployment process for the Network Glue Collector, detailing its dependencies, required EDFs, and configuration settings necessary for successful implementation on Windows machines.","permalink":"/docs/cwa/monitors/4e0f7314-bf88-44de-a162-139c191e6e09"},{"id":"cwa/dataviews/5a6640f6-f0cb-4231-845f-e48c9445aa22","title":"NTLMv1.1 Status Remote Monitor","description":"This document outlines a dataview designed to check the status of NTLMv1.1 on endpoints, highlighting the security risks associated with its use and providing implementation steps for monitoring. It emphasizes the importance of disabling NTLMv1.1 to protect sensitive information from unauthorized access.","permalink":"/docs/cwa/dataviews/5a6640f6-f0cb-4231-845f-e48c9445aa22"},{"id":"cwa/monitors/f0a04369-c67b-49e1-a042-8ca3a343881f","title":"Offline Server","description":"This document details an internal monitor designed to detect offline servers based on their last contact and heartbeat time with the RMM. It includes information on dependencies, properties, and target systems.","permalink":"/docs/cwa/monitors/f0a04369-c67b-49e1-a042-8ca3a343881f"},{"id":"cwa/monitors/87d846e1-3f32-4e3d-b4f9-4c17d2d2830f","title":"Password URL Online Computer Finder","description":"This document outlines a method to monitor for online computers that match specific location passwords, allowing for targeted operations such as running health checks on Unifi systems. It includes SQL queries for data retrieval and dependencies on ITGlue documents.","permalink":"/docs/cwa/monitors/87d846e1-3f32-4e3d-b4f9-4c17d2d2830f"},{"id":"cwa/tables/489fe175-9ac6-420c-be2e-e5faceb956fd","title":"plugin_proval_dhcp_statistics","description":"This document outlines the purpose and structure of storing information about DHCP scopes on the target machine, as gathered by the script Get DHCP Server Scope Information. It includes details about the dependencies and a comprehensive table of the data collected, including client IDs, location IDs, and IP address ranges.","permalink":"/docs/cwa/tables/489fe175-9ac6-420c-be2e-e5faceb956fd"},{"id":"cwa/tables/cd3368d8-d0b0-4ca4-972e-4adc8c1cfcfa","title":"plugin_proval_dns_extradata","description":"This document outlines the structure and purpose of the DNS data storage table for target machines, detailing the columns, their types, and the SQL command to create the table. It provides insights into how DNS settings are recorded and managed for networked computers.","permalink":"/docs/cwa/tables/cd3368d8-d0b0-4ca4-972e-4adc8c1cfcfa"},{"id":"cwa/tables/ac13e6a2-d240-4b45-b4d1-98c4a860ed8f","title":"plugin_proval_hardwaredetails (View)","description":"This document provides comprehensive details on the hardware information available for all applicable agents within an Automate environment, including specifications such as CPU usage, memory, operating system details, and more.","permalink":"/docs/cwa/tables/ac13e6a2-d240-4b45-b4d1-98c4a860ed8f"},{"id":"cwa/tables/38fbe617-1c50-443b-b69b-07eae7135652","title":"plugin_proval_speedtest_audit","description":"This document outlines the structure and purpose of the database table used to store results from internet speed tests conducted by the EPM Network script. It details the dependencies, the columns in the database table, and their explanations to facilitate understanding and usage of the stored data.","permalink":"/docs/cwa/tables/38fbe617-1c50-443b-b69b-07eae7135652"},{"id":"cwa/tables/048bcde3-a1b4-45a9-a86c-ba19c0a40933","title":"plugin_proval_unifidevices","description":"This document outlines the structure and purpose of the EPM Data Collection for the UnifiController, detailing the dependencies and table schema used for holding device data associated with each controller.","permalink":"/docs/cwa/tables/048bcde3-a1b4-45a9-a86c-ba19c0a40933"},{"id":"cwa/scripts/631186de-253a-4bd7-8197-958cb1ed7b68","title":"Printer Change IP","description":"This document outlines a script that changes the IP address of a printer from an old IP address to a new one, detailing the process, variables, and user parameters involved in the operation.","permalink":"/docs/cwa/scripts/631186de-253a-4bd7-8197-958cb1ed7b68"},{"id":"cwa/dataviews/f016ea11-da3b-4834-a5f0-3a55e3e3ad53","title":"PrintNightMare Detection","description":"This document provides a comprehensive overview of the PrintNightMare vulnerability, detailing its dependencies, relevant CVEs, and a dataview that summarizes key information about affected clients and systems.","permalink":"/docs/cwa/dataviews/f016ea11-da3b-4834-a5f0-3a55e3e3ad53"},{"id":"cwa/dataviews/54531eb6-553a-4730-8afc-558adbab450d","title":"Probe Scanned Machines Missing Automate Agent","description":"This document provides a detailed overview of the dataview that lists probe-detected machines with port 139 open, which may be missing the Automate agent. It includes information on the columns available, their descriptions, and the necessary dependencies for accurate data retrieval.","permalink":"/docs/cwa/dataviews/54531eb6-553a-4730-8afc-558adbab450d"},{"id":"cwa/tables/5a5463d0-0ce3-4c09-bd41-39da28e16d0f","title":"pvl_network_Adapter","description":"This document outlines the structure of the table that stores data gathered by the DNS Assignments script, detailing its columns, types, and explanations for each field related to network interfaces.","permalink":"/docs/cwa/tables/5a5463d0-0ce3-4c09-bd41-39da28e16d0f"},{"id":"cwa/tables/f317da6e-0ea2-4c1e-bad9-4d0ad25684d3","title":"pvl_wifi_profiles","description":"This document outlines the purpose and structure of a custom table designed to store WiFi Profiles information for each computer, including dependencies and detailed column explanations.","permalink":"/docs/cwa/tables/f317da6e-0ea2-4c1e-bad9-4d0ad25684d3"},{"id":"cwrmm/tasks/86ce1f15-d85b-472a-b35f-c4c357036ee2","title":"Remove Wifi Profile","description":"This document provides a comprehensive guide on how to implement a script that removes a specified Wifi profile from a system using ConnectWise RMM. It includes dependencies, user parameters, task creation steps, and complete script details.","permalink":"/docs/cwrmm/tasks/86ce1f15-d85b-472a-b35f-c4c357036ee2"},{"id":"powershell/ps-remove-wifiprofile","title":"Remove-WifiProfile","description":"Documentation for the Remove-WifiProfile command to remove a specified Wi-Fi profile from the system.","permalink":"/docs/powershell/ps-remove-wifiprofile"},{"id":"cwa/dataviews/8e08584e-985e-4c83-a81b-dc842844e5d0","title":"Router Public IP - Audit","description":"This dataview provides an overview of the public IP address associated with the location router, including details about the client, location, router access count, and connected agents.","permalink":"/docs/cwa/dataviews/8e08584e-985e-4c83-a81b-dc842844e5d0"},{"id":"cwa/scripts/b713bbc8-a1d9-4e08-ac77-d02b634569f6","title":"ScreenConnect Client - Command - Execute","description":"This document outlines a script that executes a command through the default command-line parser on the target agent via Control, detailing user parameters, system properties, and expected output.","permalink":"/docs/cwa/scripts/b713bbc8-a1d9-4e08-ac77-d02b634569f6"},{"id":"cwa/dataviews/aa31f8b3-9d5e-4ad1-98cc-a6e1d329cb1f","title":"Security - TLS Status","description":"This document provides an overview of a dataview that enables auditing of TLS versions on endpoints. It highlights the importance of understanding which versions of TLS are enabled for secure communication between machines and servers. The document also outlines dependencies and provides a detailed description of the columns in the dataview.","permalink":"/docs/cwa/dataviews/aa31f8b3-9d5e-4ad1-98cc-a6e1d329cb1f"},{"id":"powershell/ps-set-dnsserversscavengingsetting","title":"Set-DNSServersScavengingSetting","description":"Documentation for the Set-DNSServersScavengingSetting command to enable DNS scavenging and set intervals for Scavenging, No-refresh, and Refresh.","permalink":"/docs/powershell/ps-set-dnsserversscavengingsetting"},{"id":"powershell/ps-set-netadapterdns","title":"Set-NetAdapterDNS","description":"Documentation for the Set-NetAdapterDNS command to append a DNS server address to all physical, active network adapters.","permalink":"/docs/powershell/ps-set-netadapterdns"},{"id":"cwa/scripts/13e225e3-ebab-45f8-ac25-f1a15eb4ac80","title":"ShadowControl Installer","description":"This document provides a detailed guide on a script that automates the download and installation of the ShadowControl client on a target machine, including steps for subscribing to the appropriate ShadowControl server and cleaning up after installation.","permalink":"/docs/cwa/scripts/13e225e3-ebab-45f8-ac25-f1a15eb4ac80"},{"id":"cwa/scripts/dc9e4596-2cce-49b2-9f64-d6dfd46ac1ec","title":"Shared Folder Audit","description":"This document describes a script that collects detailed information about shared folder access, including share names, paths, types, user permissions, and access rights. The automation of this process saves approximately 10 minutes of manual work.","permalink":"/docs/cwa/scripts/dc9e4596-2cce-49b2-9f64-d6dfd46ac1ec"},{"id":"cwa/monitors/de67816f-e6ff-4fed-92e1-26fd5ae5359d","title":"SMB1 Detection","description":"This document outlines the procedure to check whether SMB1 is enabled on a Windows machine. It includes details on how to fetch the data using compatible commands and provides guidelines on the appropriate usage of the monitor set for Windows workstations and servers.","permalink":"/docs/cwa/monitors/de67816f-e6ff-4fed-92e1-26fd5ae5359d"},{"id":"cwa/monitors/7665cb82-1340-4f76-ba0e-e7c277c40f73","title":"SMB1 Traffic Detection","description":"This document outlines the SMB1 Server Auditing Remote Monitor, which activates auditing for SMB1 connections and reviews event logs for client connection attempts. It serves to identify environments still using the SMB1 protocol before disabling it.","permalink":"/docs/cwa/monitors/7665cb82-1340-4f76-ba0e-e7c277c40f73"},{"id":"cwa/dataviews/ee9ae5d4-3ab4-462b-8d90-63a5604a18a4","title":"Software - Open DNS - Global Agent Audit","description":"This document provides an overview of the Global Dataview that displays every Windows machine in the environment and indicates whether the Umbrella_RC service is installed, suggesting that OpenDNS is being utilized. It aims to assist Managed Service Providers (MSPs) in optimizing their licensing and deployment of the Umbrella agent based on the machines\u2019 connectivity and requirements.","permalink":"/docs/cwa/dataviews/ee9ae5d4-3ab4-462b-8d90-63a5604a18a4"},{"id":"cwa/dataviews/f943b29e-998e-48be-8327-c03ee9c0818e","title":"Software - Open DNS - Machines Missing Open DNS W Wireles","description":"This document provides a dataview to identify machines with Open DNS (Umbrella Agent) installed and checks for the presence of a wireless network card. It aims to help in finding devices unnecessarily using Open DNS when configured at the router/firewall level. By identifying endpoints without wireless capabilities, organizations can reduce costs associated with the Open DNS solution.","permalink":"/docs/cwa/dataviews/f943b29e-998e-48be-8327-c03ee9c0818e"},{"id":"cwa/dataviews/ff05755d-c0eb-4617-82fd-33e74e95b34c","title":"Software - Remote Access Apps","description":"This document provides a comprehensive overview of well-known remote access software installed on systems. It includes detection capabilities for various popular remote access tools, along with a detailed column description of the data collected.","permalink":"/docs/cwa/dataviews/ff05755d-c0eb-4617-82fd-33e74e95b34c"},{"id":"cwa/dataviews/a15c39f0-c19e-413a-8d21-7ea44529be05","title":"Speedtest Record Script","description":"This document provides an overview of the Speed Test Dataview, detailing how it displays key metrics such as upload speed, download speed, and latency. It also outlines the dependencies and columns included in the Dataview for enhanced performance monitoring.","permalink":"/docs/cwa/dataviews/a15c39f0-c19e-413a-8d21-7ea44529be05"},{"id":"cwa/scripts/d7f9015f-0d7c-4bfb-b624-4600f4774b65","title":"SWM - Software - InstallUpdate Sonicwall NetExtender Winget","description":"This document provides a comprehensive overview of a script designed to install or update the SonicWall NetExtender application on target devices using Winget. It includes sample runs, variable descriptions, and process details to ensure effective deployment.","permalink":"/docs/cwa/scripts/d7f9015f-0d7c-4bfb-b624-4600f4774b65"},{"id":"powershell/ps-test-internetspeed","title":"Test-InternetSpeed","description":"Documentation for the Test-InternetSpeed command to run an internet speed test via the Ookla SpeedTest CLI application.","permalink":"/docs/powershell/ps-test-internetspeed"},{"id":"cwa/scripts/7e7eb565-3b99-4e6f-89f8-6257f5b4e7d6","title":"Ticket Creation - ESXi Not Communicating","description":"This document details a script designed for creating tickets related to ESXi hosts that have not communicated for over 3 days. The script is monitor-driven, ensuring it runs automatically based on specific conditions and gathers necessary information to create a detailed ticket for IT support.","permalink":"/docs/cwa/scripts/7e7eb565-3b99-4e6f-89f8-6257f5b4e7d6"},{"id":"cwa/scripts/61158e8d-5349-418a-9cd8-81685d622846","title":"Ticket Creation - ESXi Storage 10 Percent","description":"This document details a script designed for automatic ticket creation when an ESXi host reports low storage space. It is intended to be triggered by a monitor and outlines the process for gathering necessary information and generating a ticket with relevant details about the ESXi host and its virtual machines.","permalink":"/docs/cwa/scripts/61158e8d-5349-418a-9cd8-81685d622846"},{"id":"cwrmm/monitors/e6735934-f31f-4993-94b5-c297546ede23","title":"Time Sync Compliance","description":"This document provides a step-by-step guide on creating a Time Sync Compliance Monitor that syncs machine time with us.pool.ntp.org, ensuring accurate timekeeping across devices.","permalink":"/docs/cwrmm/monitors/e6735934-f31f-4993-94b5-c297546ede23"},{"id":"cwa/dataviews/3210ea64-6a5d-416d-aea8-8e5399c0e62c","title":"TPM Detailed Info","description":"This document provides detailed information about the TPM configuration on endpoints, including the status of TPM readiness, presence, and various security levels associated with the TPM on each client machine.","permalink":"/docs/cwa/dataviews/3210ea64-6a5d-416d-aea8-8e5399c0e62c"},{"id":"cwa/roles/132a68a2-5d49-49b5-994f-4baf4606f816","title":"VMware Host Not Detected in Virtualization Manager Plugin","description":"This document provides guidance on troubleshooting incorrect configurations that may cause VMware host detection failures. It outlines steps for verifying probe and credential configurations, ensuring successful detection of VMware hosts within your network.","permalink":"/docs/cwa/roles/132a68a2-5d49-49b5-994f-4baf4606f816"},{"id":"vsa/variables/2e21d3a9-d6c7-4279-895b-ad029fab84b7","title":"VSA_API_ARGS","description":"This document outlines the necessary parameters required for using VSAToolbox, a set of tools designed to interact with a Kaseya VSA server API. It includes details on dependencies, example data, and the correct format for API arguments.","permalink":"/docs/vsa/variables/2e21d3a9-d6c7-4279-895b-ad029fab84b7"},{"id":"cwa/scripts/52b6b460-b6bd-48cf-aab1-8484149578f0","title":"WiFi Profile - Apply","description":"This document provides a detailed overview of a script that applies WiFi configuration for a specified SSID, including dependencies, user parameters, and the process involved. It highlights the time saved by automation and includes a sample run of the script.","permalink":"/docs/cwa/scripts/52b6b460-b6bd-48cf-aab1-8484149578f0"},{"id":"solutions/d0357bdb-80ab-4106-aee0-21a064150986","title":"WiFi Profiles","description":"This document provides a comprehensive guide on the updated script for managing Wi-Fi profiles, including features for adding, removing, and auditing profiles on end machines. It highlights the necessary updates, implementation steps, and associated content to ensure effective management of Wi-Fi profiles while enhancing security.","permalink":"/docs/solutions/d0357bdb-80ab-4106-aee0-21a064150986"},{"id":"cwa/monitors/3a1d1f7d-a655-40bf-a048-5e861aee00ae","title":"Wifi Profiles - Add","description":"This document outlines the purpose and functionality of a monitor set designed to identify computers lacking specified Wi-Fi profiles. It details how the monitor set utilizes data from a custom table and triggers a script to implement missing profiles, ensuring proper configuration and management of Wi-Fi settings across client environments.","permalink":"/docs/cwa/monitors/3a1d1f7d-a655-40bf-a048-5e861aee00ae"},{"id":"cwa/dataviews/18505efc-1e3d-4d75-97d9-6c10e5de540f","title":"Windows - Domain Information","description":"This document provides a comprehensive overview of how a computer is domain joined, detailing the different types of domain join statuses including Azure AD, Hybrid, DRS Joined, On-Prem, and Not Joined. It includes dependencies and a detailed column description for better understanding.","permalink":"/docs/cwa/dataviews/18505efc-1e3d-4d75-97d9-6c10e5de540f"},{"id":"cwa/dataviews/328695bc-c79f-4f18-a679-7c451c8cc272","title":"Windows - Firewall Status","description":"This document provides a detailed overview of a dataview that displays information related to the configuration of the Windows firewall on endpoints, including the status of domain, private, and public firewalls.","permalink":"/docs/cwa/dataviews/328695bc-c79f-4f18-a679-7c451c8cc272"},{"id":"cwa/dataviews/6925218d-aa6b-4919-a873-262691c16b9e","title":"Windows - RDP Audit","description":"This document provides a detailed dataview that shows whether RDP is enabled or disabled on agents, based on their dependent roles. It includes important information such as client name, location name, computer name, operating system, agent status, and RDP status. Note that the dataview reflects role-dependent changes and may not show immediate status updates.","permalink":"/docs/cwa/dataviews/6925218d-aa6b-4919-a873-262691c16b9e"},{"id":"cwa/roles/2aa464bf-472c-48db-a3a8-f8fc1aa11091","title":"Windows - RDP Enabled","description":"This document outlines the detection of Remote Desktop Protocol (RDP) enabled on agents. It provides the detection string, comparator, result, and applicable operating systems for effective monitoring and management.","permalink":"/docs/cwa/roles/2aa464bf-472c-48db-a3a8-f8fc1aa11091"}],"unlisted":false}}')}}]);